  }
  return(
    <div className="client-home-container">
      <header>
        <h1>{ client.name }</h1>
        <p>CPF/CNPJ: { client.cpf_cnpj }</p>
        <p>Cadastrado em: { formatDate(client.register) }</p>
      </header>
    </div>
  )
